VALUES (1, 5.0, 4.0, 5.0, 5.0, '맛있고 서비스도 좋았습니다. 해물짬뽕이 맛있었습니다.', 1, 1, '2023-03-05 0:00:00'),
       (2, 4.5, 4.0, 4.5, 4.5, '바 형식으로 되어있어 자리가 많지 않지만 회전율이 좋습니다.', 2, 2, '2023-11-05 0:00:00'),
       (3, 5.0, 4.5, 5.0, 5.0, '바다가 근처라 뷰도 좋습니다. 맛은 말할 것 없을 정도로 너무 좋았습니다!', 3, 3, '2023-05-05 0:00:00'),
       (4, 4.5, 4.0, 4.5, 4.5, '신선한 해산물로 만든 요리가 인상적이었어요. 친절한 직원 덕분에 기분 좋게 식사했어요.', 4, 4, '2023-12-25 0:00:00'),
       (5, 4.0, 3.5, 4.0, 4.0, '다양한 메뉴가 준비되어 있어서 가족 모두 만족했습니다. 특히 탕수육이 맛있었어요.', 5, 5, '2023-04-05 0:00:00'),
       (6, 4.5, 4.0, 4.5, 4.5, '깔끔한 인테리어와 고급스러운 분위기가 좋았습니다. 다시 방문하고 싶어요.', 6, 6, '2023-05-12 0:00:00'),
       (7, 4.0, 3.5, 4.0, 4.0, '가격 대비 만족도가 높아요. 특히 볶음밥이 맛있었습니다.', 7, 7, '2023-06-06 0:00:00'),
       (8, 5.0, 4.5, 5.0, 5.0, '직원들이 정말 친절하고 세심하게 신경 써줘서 기분 좋게 식사했어요.', 8, 8, '2023-05-19 0:00:00'),
       (9, 5.0, 4.0, 4.5, 5.0, '바로 앞에 바다가 보여서 경치도 좋고, 음식도 정말 맛있었어요.', 9, 9, '2023-06-09 0:00:00'),
       (10, 5.0, 4.5, 5.0, 5.0, '메뉴가 다양하고 맛도 뛰어나서 가족 모임 장소로 제격이었어요.', 10, 10, '2023-11-05 0:00:00'),
       (11, 4.5, 4.0, 4.5, 4.5, '음식이 빠르게 나와서 좋았습니다. 바삭한 군만두가 특히 기억에 남아요.', 11, 11, '2023-11-05 0:00:00'),
       (12, 5.0, 4.5, 5.0, 5.0, '정말 깔끔하고 맛있었어요. 서비스도 훌륭하고요.', 12, 12, '2023-04-05 0:00:00'),
       (13, 5.0, 4.5, 5.0, 5.0, '중식 요리의 깊은 맛을 느낄 수 있는 곳입니다. 특히 사천탕수육이 일품이에요.', 13, 13, '2023-05-03 0:00:00'),
       (14, 4.5, 4.0, 4.5, 4.5, '모든 음식이 신선하고 맛있었습니다. 다음에 또 방문할 예정입니다.', 14, 14, '2023-01-04 0:00:00'),
       (15, 5.0, 4.5, 5.0, 5.0, '바다가 보이는 멋진 풍경과 함께 즐기는 중식은 최고의 경험이었어요.', 15, 15, '2024-05-11 0:00:00'),
       (16, 4.5, 4.0, 4.5, 4.5, '해물요리가 특히 맛있었고, 분위기도 매우 좋았습니다.', 16, 16, '2022-05-13 0:00:00'),
       (17, 5.0, 4.5, 5.0, 5.0, '아이들과 함께 갔는데 모두 만족했습니다. 다음에도 꼭 다시 방문할게요.', 17, 17, '2024-06-10 0:00:00'),
       (18, 4.5, 4.0, 4.5, 4.5, '음식의 맛과 품질 모두 최고였습니다. 가격도 합리적이에요.', 18, 18, '2022-06-08 0:00:00'),
       (19, 5.0, 4.5, 5.0, 5.0, '깔끔한 분위기와 친절한 서비스가 인상적이었습니다. 음식 맛도 최고였어요.', 19, 19, '2022-05-06 0:00:00'),
       (20, 1.0, 3.0, 1.0, 3.0, '음식이 너무 짰어요. 서비스도 그저 그랬습니다.', 20, 20, '2023-06-07 0:00:00'),
